import React from 'react';
import logo from './logo.svg';
import FilterPanel from './components/FilterPanel/FilterPanel';
import SpaceComponent from './components/SpaceComponent/SpaceComponent';
import SpaceInfoComponent from './components/SpaceInfoComponent/SpaceInfoComponent';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Space X Launch Program
      </header>
      <div>
      <FilterPanel/>
      <SpaceComponent>
        <SpaceInfoComponent></SpaceInfoComponent>
      </SpaceComponent>
      </div>
    </div>
  );
}

export default App;
